import React, { Component } from 'react';

//body structure css
import './App.css';

import './Register.css';

class Register extends Component {
    render(){
        return(
            <div id='registerApp'>
                <div id='topContainer'>
                    <div id='logoContainer'>
                        <p><span id='firstPartLogo'>Tudor</span><span>Flix</span></p>
                    </div>
                    <div id='signUpLinkContainer'>
                        <p>Don't have an account? <span id='createAccountLink'>Create Account</span></p>
                    </div>
                </div>
                <div id='loginContainer'>
                    <p id='loginTitle'>Log In</p>
                    <p id='sublogintitle'>Login To Your TudorFlix Account</p>
                    <div id='formContainer'>
                        <p className='InputTitleText'>Username:</p>
                        <input className='userInputBox'></input>
                        <div id='passwordForgotContainer'>
                            <p className='InputTitleText'>Password:</p>
                            <p id='forgotPasswordText'>Forgot Your Password?</p>
                        </div>
                        <input className='userInputBox'></input>
                    </div>
                    <div id='loginButton'>

                    </div>
                </div>
            </div>
        )
    }
}

export default Register;
